const GastoFormView = ({ monto, concepto, onMontoChange, onConceptoChange, onSubmit }) => (
  <form onSubmit={onSubmit} className="max-w-md mx-auto mt-10 p-6 bg-white rounded-2xl shadow-lg space-y-4">
    <h2 className="text-2xl font-bold text-center">Registrar Gasto</h2>
    <input
      type="number"
      placeholder="Monto"
      value={monto}
      onChange={onMontoChange}
      className="w-full p-3 border border-gray-300 rounded-xl focus:outline-none focus:ring-2 focus:ring-blue-400"
    />
    <input
      type="text"
      placeholder="Concepto"
      value={concepto}
      onChange={onConceptoChange}
    />
    <button
      type="submit"

    >
      Registrar
    </button>
  </form>
);

export default GastoFormView;
